import React from 'react';

function Header(){
return <div>
    
   
  <Header id="site-header" className="fixed-top"> <div className="container">
      <nav className="navbar navbar-expand-lg navbar-dark stroke">
        <h1>
          <a className="navbar-brand" href="index.html">
            <span className="fa fa-align-right"></span> Corp Vision <span className="logo">Vision to your Future</span></a>
        </h1></nav>
        </div>
        </Header>
</div>;
}

export default Header;
